import React, { Component } from "react";
import Figure from 'react-bootstrap/Figure';
import Container from 'react-bootstrap/Container';
import 'bootstrap/dist/css/bootstrap.min.css';


interface Props {
};

interface State {
}


class TestImage extends Component<Props, State>
{
    constructor(props: Props) {
        super(props);
    }

    render() {

        return (

            <Container>

                <h3>Demonstracja wstawiania obrazka z pliku.</h3>

                <Figure>
                    <Figure.Image
                        width={200}
                        height={300}                        
                        src="./images/logo.png"
                    />
                    <Figure.Caption>
                        To jest logo React-a.
                    </Figure.Caption>
                </Figure>

            </Container>
        );
    }
}

export default TestImage;
